import React from 'react';
import CategoryRow from '../CategoryRow/CategoryRow';
import styles from './ContentContainer.module.css';

function ContentContainer({ data, onBlockSelect }) {
  return (
    <div id="content-container" className={styles.contentContainer}>
      <div className={styles.header}>L1</div>
      <div className={styles.header}>L2</div>
      <div className={styles.header}>L3</div>
      <div className={styles.header}>L4</div>
      <div className={styles.header}>L5</div>
      
      {data.map((category, categoryIndex) => (
        <CategoryRow
          key={category.id}
          category={category}
          onBlockSelect={onBlockSelect}
          categoryIndex={categoryIndex}
        />
      ))}
    </div>
  );
}

export default ContentContainer;
